import axios from "axios";
import authHeader from "./authHeader";

const API_URL = "http://localhost:8000/api/";

const getUserData = () => {
    return axios.get(API_URL + "profil", { headers: authHeader(), Accept: "application/json" });
};

const userService = {
    getUserData,
  };
  export default userService;
